import React from "react"

function Card(props) {
    const styles = {
        backgroundColor: props.cardColor,
        height: props.cardHeight,
        width: props.cardWidth
    }

    return (
        <div style={styles}></div>
    )
}
//default props
Card.defaultProps = {
    cardColor: "blue",
       cardHeight: 100,
        cardWidth: 100
}

export default Card
